inputList = input.split("\n")
 
totalLegit = 0
totalLegitNew = 0
 
for pwdPolicy in inputList:
    components = pwdPolicy.split(" ")
    num1 = int(components[0].split("-")[0])
    num2 = int(components[0].split("-")[1])
    letter = components[1][0]
    pwd = components[2]
    # print("{}-{} {}: {}".format(str(minCount), str(maxCount), letter, pwd))
 
    count = 0
    for char in pwd:
        if char == letter:
            count += 1
 
    if count >= num1 and count <= num2:
        totalLegit += 1
 
